import React, { useState, useEffect } from 'react';
import { Link, useLocation } from 'react-router-dom';
import './ProviderDashboard.css';

const ProviderDashboard = ({ user }) => {
    const [listings, setListings] = useState([]);
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(true);
    const location = useLocation();

    useEffect(() => {
        const fetchMyListings = async () => {
            try {
                const token = localStorage.getItem('authToken');
                const res = await fetch('http://localhost:5000/api/listings/my-listings', {
                    headers: { 'Authorization': `Bearer ${token}` }
                });
                if (!res.ok) throw new Error('Failed to fetch your listings');
                const data = await res.json();
                setListings(data);
            } catch (err) {
                setError(err.message);
            } finally {
                setLoading(false);
            }
        };
        fetchMyListings();
    }, []);

    const handleDelete = async (listingId) => {
        if (!window.confirm("Are you sure you want to delete this listing?")) return;
        try {
            const token = localStorage.getItem('authToken');
            const res = await fetch(`http://localhost:5000/api/listings/${listingId}`, {
                method: 'DELETE',
                headers: { 'Authorization': `Bearer ${token}` }
            });
            if (!res.ok) throw new Error('Failed to delete listing');
            setListings(listings.filter(l => l.id !== listingId));
        } catch (err) {
            setError(err.message);
        }
    };

    if (loading) return <div className="loading-message">Loading your listings...</div>;

    return (
        <div className="provider-dashboard-container">
            <div className="provider-dashboard-card">
                <header className="provider-header">
                    <h1>Provider Dashboard</h1>
                    <div className="dashboard-nav">
                        <Link to="/dashboard" className={`nav-link ${location.pathname === '/dashboard' ? 'active' : ''}`}>My Services</Link>
                        <Link to="/availability" className={`nav-link ${location.pathname === '/availability' ? 'active' : ''}`}>My Availability</Link>
                    </div>
                </header>

                <div className="listings-header">
                    <h2>Your Service Listings</h2>
                    <Link to="/create-listing" className="btn-create-listing">+ Add New Service</Link>
                </div>

                {error && <div className="error-message">{error}</div>}
                
                {listings.length > 0 ? (
                    <table className="listings-table">
                        <thead>
                            <tr>
                                <th>Title</th>
                                <th>Category</th>
                                <th>Price</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
                            {listings.map(listing => (
                                <tr key={listing.id}>
                                    <td>{listing.title}</td>
                                    <td>{listing.category_name}</td>
                                    <td>${listing.price}</td>
                                    <td className="action-buttons">
                                        <button className="btn-action btn-edit">Edit</button>
                                        <button className="btn-action btn-delete" onClick={() => handleDelete(listing.id)}>Delete</button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                ) : (
                    <p className="no-listings-message">You haven't created any services yet. Click "Add New Service" to get started!</p>
                )}
            </div>
        </div>
    );
};

export default ProviderDashboard;
